import React from 'react'
import img from './placeholder.png'
import PortfolioItem from './PortfolioItem'
//import img2 from './placeholder2.png'
import Box from '@mui/material/Box';
import Stack from '@mui/material/Stack';
import Head from './Head';
import CV from './CV';

const HomePage = () =>{
  const titles = ["T1","T2","T3","T4"]
  const desc = ["Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica","T2","T3","T4"]
  const images= [img,img,img,img]
  return (
    <div>
    <Head/>
    <CV/>
<Stack spacing={2}>
      <PortfolioItem image ={images[0]} text = {descs[0]} title = {titles[0]}  link = 'poopy'/>
      <PortfolioItem image ={images[0]} text = {descs[0]} title = {titles[0]}  link = 'poopy'/>
      <PortfolioItem image ={images[0]} text = {descs[0]} title = {titles[0]}  link = 'poopy'/>
      <PortfolioItem image ={images[0]} text = {descs[0]} title = {titles[0]}  link = 'poopy'/>
      <PortfolioItem image ={images[0]} text = {descs[0]} title = {titles[0]}  link = 'poopy'/>
</Stack>
     </div>
   )
 }

      // <PortfolioItem image ={img} text = {'HALLO'} link = 'poopy'/>
      // <PortfolioItem image ={img} text = {'HALLO'} link = 'poopy'/>
      // <PortfolioItem image ={img} text = {'HALLO'} link = 'poopy'/>



